val.onclick:
if( !this.classList.contains('on') )
{
   this.classList.add('on');
   drawsocket.input({
     key: 'tween',
     val: {
       id: 'score-tween',
       cmd: 'play'
     }
   });
} else { 
   this.classList.remove('on');
   drawsocket.input({
     key: 'tween',
     val: {
       id: 'score-tween',
       cmd: 'reset'
     }
   });
}
